import { StyleSheet } from "aphrodite/no-important";

var green = "#219653";
var grey = "#e0e0e0";
export default StyleSheet.create({

  block__login: {
    backgroundcolor: "#ffffff",
    border: "1px solid #e0e0e0",
    borderradius: "10px",
    marginTop: "55px",
    paddingleft: "40px",
    paddingright: "40px",
    paddingtop: "64px",
